160;\u2014 \u041f\u0440\u0438\u043d\u044f\u0442 \u0437\u0430\u043a\u043e\u043d, \u0440\u0430\u0437\u0440\u0435\u0448\u0430\u044e\u0449\u0438\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D1%80%D0%B5%D0%BF%D0%BE%D1%81%D1%82%D0%BD%D0%BE%D0%B5_%D0%BF%D1%80%D0%B0%D0%B2%D0%BE\" title=\"\u041a\u0440\u0435\u043f\u043e\u0441\u0442\u043d\u043e\u0435 \u043f\u0440\u0430\u0432\u043e\">\u043a\u0440\u0435\u043f\u043e\u0441\u0442\u043d\u044b\u043c<\/a> \u043a\u0440\u0435\u0441\u0442\u044c\u044f\u043d\u0430\u043c \u043f\u0440\u0438\u043e\u0431\u0440\u0435\u0442\u0430\u0442\u044c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%B5%D0%B4%D0%B2%D0%B8%D0%B6%D0%B8%D0%BC%D0%BE%D1%81%D1%82%D1%8C\" title=\"\u041d\u0435\u0434\u0432\u0438\u0436\u0438\u043c\u043e\u0441\u0442\u044c\">\u043d\u0435\u0434\u0432\u0438\u0436\u0438\u043c\u0443\u044e \u0441\u043e\u0431\u0441\u0442\u0432\u0435\u043d\u043d\u043e\u0441\u0442\u044c<\/a> \u0441 \u0441\u043e\u0433\u043b\u0430\u0441\u0438\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%BE%D0%BC%D0%B5%D1%89%D0%B8%D0%BA\" title=\"\u041f\u043e\u043c\u0435\u0449\u0438\u043a\">\u043f\u043e\u043c\u0435\u0449\u0438\u043a\u0430<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1867_%D0%B3%D0%BE%D0%B4\" title=\"1867 \u0433\u043e\u0434\">1867<\/a>&#160;\u2014 \u0417\u0430\u043a\u043b\u044e\u0447\u0435\u043d\u0438\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%B2%D1%81%D1%82%D1%80%D0%BE-%D0%B2%D0%B5%D0%BD%D0%B3%D0%B5%D1%80%D1%81%D0%BA%D0%BE%D0%B5_%D1%81%D0%BE%D0%B3%D0%BB%D0%B0%D1%88%D0%B5%D0%BD%D0%B8%D0%B5\" title=\"\u0410\u0432\u0441\u0442\u0440\u043e-\u0432\u0435\u043d\u0433\u0435\u0440\u0441\u043a\u043e\u0435 \u0441\u043e\u0433\u043b\u0430\u0448\u0435\u043d\u0438\u0435\">\u0430\u0432\u0441\u0442\u0440\u043e-\u0432\u0435\u043d\u0433\u0435\u0440\u0441\u043a\u043e\u0433\u043e \u0441\u043e\u0433\u043b\u0430\u0448\u0435\u043d\u0438\u044f<\/a> \u043e \u043f\u0440\u0435\u043e\u0431\u0440\u0430\u0437\u043e\u0432\u0430\u043d