u0438\u043b (\u0432 \u0447\u0430\u0441\u0442\u043d\u043e\u0441\u0442\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%BE%D0%BB%D1%8C%D1%88%D0%B5%D0%B2%D0%B8%D0%BA%D0%B8\" title=\"\u0411\u043e\u043b\u044c\u0448\u0435\u0432\u0438\u043a\u0438\">\u0431\u043e\u043b\u044c\u0448\u0435\u0432\u0438\u043a\u043e\u0432<\/a>) \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%BE%D1%81%D1%81%D0%B8%D0%B9%D1%81%D0%BA%D0%B0%D1%8F_%D0%B8%D0%BC%D0%BF%D0%B5%D1%80%D0%B8%D1%8F\" title=\"\u0420\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u0430\u044f \u0438\u043c\u043f\u0435\u0440\u0438\u044f\">\u0420\u043e\u0441\u0441\u0438\u0438<\/a>, \u0441\u0432\u0435\u0440\u0436\u0435\u043d\u0438\u0435 \u0433\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0435\u043d\u043d\u043e\u0433\u043e \u0441\u0442\u0440\u043e\u044f \u0438\u043c\u043f\u0435\u0440\u0438\u0438 \u0438 \u043f\u043e\u0441\u043b\u0435\u0434\u0443\u044e\u0449\u0438\u0439 \u0432\u044b\u0445\u043e\u0434 \u0435\u0451 \u0438\u0437 \u0432\u043e\u0439\u043d\u044b \u0441 \u0437\u0430\u043a\u043b\u044e\u0447\u0435\u043d\u0438\u0435\u043c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D1%80%D0%B5%D1%81%D1%82-%D0%9B%D0%B8%D1%82%D0%BE%D0%B2%D1%81%D0%BA%D0%B8%D0%B9_%D0%BC%D0%B8%D1%80%D0%BD%D1%8B%D0%B9_%D0%B4%D0%BE%D0%B3%D0%BE%D0%B2%D0%BE%D1%80\" class=\"mw-redirect\" title=\"\u0411\u0440\u0435\u0441\u0442-\u041b\u0438\u0442\u043e\u0432\u0441\u043a\u0438\u0439 \u043c\u0438\u0440\u043d\u044b\u0439 \u0434\u043e\u0433\u043e\u0432\u043e\u0440\">\u0441\u0435\u043f\u0430\u0440\u0430\u0442\u043d\u043e\u0433\u043e \u043c\u0438\u0440\u0430<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1917_%D0%B3%D0%BE%D0%B4\" title=\"1917 \u0433\u043e\u0434\">1917<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%B8%D0%BA%D0%BE%D0%BB%D0%B0%D0%B9_II\" title=\"\u041d\u0438\u043a\u043e\u043b\u0430\u0439 II\">\u041d\u0438\u043a\u043e\u043b\u0430\u0439 II<\/a> \u043f\u043e\u0434\u043f\u0438\u0441\u0430\u043b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9E%D1%82%D1%80%D0%B5%D1%87%D0%B5%D0%BD%D0%B8%D0%B5_%D0%9D%D0%B8%D0%BA%D0%BE%D0%BB%D0%B0%D1%8F_II\" title=\"\u041e\u0442\u0440\u0435\u0447\u0435\u043d\u0438\u0435 \u041d\u0438\u043a\u043e\u043b\u0430\u044f II\">\u043e\u0442\u0440\u0435\u0447\u0435\u043d\u0438\u0435 \u043e\u0442 \u043f\u0440\u0435\u0441\u0442\u043e\u043b\u0430<\/a> \u0432 \u043f\u043e\u043b\u044c\u0437\u0443 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B8%D1%85%D0%B0%D0%B8%D0%BB_%D0%90%D0%BB%D0%B5%D0%BA%D1%81%D0%B0%D0%BD%D0%B4%D1%80%D0%BE%D0%B2%D0%B8%D1%87_(%D1%81%D1%8B%D0%BD_%D0%90%D0%BB%D0%B5%D0%BA%D1%81%D0%B0%D0%BD%D0%B4%D1%80%D0%B0_III)\" title=\"\u041c\u0438\u0445\u0430\u0438\u043b \u0410\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440\u043e\u0432\u0438\u0447 (\u0441\u044b\u043d \u0410\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440\u0430 III)\">\u0441\u0432\u043e\u0435\u0433\u043e \u0431\u0440\u0430\u0442\u0430<\/a>. \u041e\u0434\u043d\u043e\u0432\u0440\u0435\u043c\u0435\u043d\u043d\u043e \u0441 \u044d\u0442\u0438\u043c \u0432 \u041f\u043e\u0434\u043c\u043e\u0441\u043a\u043e\u0432\u044c\u0435 \u0431\u044b\u043b\u0430 \u043d\u0430\u0439\u0434\u0435\u043d\u0430 \u0437\u043d\u0430\u0447\u0438\u043c\u0430\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D0%BA%D0%BE%D0%BD%D0%B0_%D0%91%D0%BE%D0%B6%D0%B8%D0%B5%D0%B9_%D0%9C%D0%B0%D1%82%D0%B5%D1%80%D0%B8_%C2%AB%D0%94%D0%B5%D1%80%D0%B6%D0%B0%D0%B2%D0%BD%D0%B0%D1%8F%C2%BB\" title=\"\u0418\u043a\u043e\u043d\u0430 \u0411\u043e\u0436\u0438\u0435\u0439 \u041c\u0430\u0442\u0435\u0440\u0438 \u00ab\u0414\u0435\u0440\u0436\u0430\u0432\u043d\u0430\u044f\u00bb\">\u0414\u0435\u0440\u0436\u0430\u0432\u043d\u0430\u044f \u0438\u043a\u043e\u043d\u0430 \u0411\u043e\u0433\u043e\u0440\u043e\u0434\u0438\u0446\u044b<\/a>, \u0441\u0432\u044f\u0437\u044b\u0432\u0430\u0435\u043c\u0430\u044f \u0441 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%BE%D0%BD%D0%B0%D1%80%D1%85%D0%B8%D0%B7%D0%BC_%D0%B2_%D0%A0%D0%BE%D1%81%D